import React from 'react';

function ProjectsPage(props){
        return(
            <div>
                <Hero title={props.title} />

                <Content>
                    <p>Take a look around at the web development projects that I've created below.</p>
                </Content>
                <Carousel />
            </div>
        );

}
export default ProjectsPage;
